import { Fragment } from 'react';
import ListarFacturas from './Pages/ListarFacturas';
import AltaFacturas from './Pages/ListarFacturas';
import ModificarFacturas from './Pages/ListarFacturas';
import iFactura from './Interfaces/Interfaces';
import { type } from 'os';
const arr: string[] =[
  'emma',
  'celes',
  'jime'
];

type HandlerInputChange = ChangeEvent<HTMLInputElement | HTMLTextAreaElement>;
const App = () => {
  const [facturas, setFacturas] = React.useState<iFactura[]>([{
    IDComision: 0, 
    NombrePrestador: "", 
    CuitPrestador: "",  
    NroPrestador: "",  
    TipoFactura: "", 
    ImporteFacturado: 0, 
    NroFactura: "", 
  }]);

  const newAddFactura = (factura:iFactura) => {
    setFacturas(...facturas, factura);
  }


  return (
    <Fragment>
      <ListarFacturas />
      <AltaFacturas />
      <ModificarFacturas />
    </Fragment>
  );
}

export default App;
